 const [inputvale, setInputValue]=useState();
    return (
        <from className="Search">
             <input name="search" onChange={handleInputValue} value={inputvale} placeholder="Food Search"  id="search"/>
             <button type="submit">Search</button>
        </from>
       
    );
}
